  false,\n\t\"url\": null,\n\t\"notes\": \"An investigation of the ecology and population
  dynamics of Alaskan polar bears has continued since 1967. As part of that program,
  U.S. Fish and Wildlife Service personnel conducted polar bear capturing and marking
  programs near Barter Island in October and November 1981 and March and April 1982.
  We also captured and tagged polar bears in the Prudhoe Bay area in April 1982. Prudhoe
  Bay, the starting point of the famous Alaskan Oil Pipeline lies on the Beaufort
  seacoast. Barter Island lies 100 miles east of Prudhoe Bay. This report describes
  activities addressing all project objectives. Polar bear studies are continuing.
  Results are reported here, and inferences are drawn in order to stimulate thought,
  speculation, and discussion and should not be viewed as final.\",\n\t\"license_title\":
